import Nav from "react-bootstrap/Nav";

const MenuNav = () => {
  return (
    <div>
      <Nav defaultActiveKey="/home" className="flex-column Toggle navigation">
        <Nav.Link href="/home" className="menu_links">
          LA MARQUE
        </Nav.Link>
        <Nav.Link eventKey="/boutique" className="menu_links">
          BOUTIQUE EN LIGNE
        </Nav.Link>
        <Nav.Link eventKey="/contact" className="menu_links">
          CONTACT
        </Nav.Link>
      </Nav>
    </div>
  );
};

export default MenuNav;
